import React, { useContext } from 'react'
import Todo from './Todo'
import { TodosContext } from '../context/TodosContext'

export default function TodoList() {
  const { todos } = useContext(TodosContext)
  return (
    <ul>
      {todos.map((todo) => <Todo todo={todo} />)}
    </ul>
  )
}
